import tarjeta from "./tarjeta.module.css";
import logo from "../../assets/img/usuario.png";

const Tarjeta = () => {

    return (
        <div className={tarjeta.pw}>
            <section className={tarjeta.box}>
        <img src={logo} />
        <h2>Bienvenido</h2>
        <p>Inicio de sesion exitoso</p>

        </section>

        </div>
        
    )
    
}

export default Tarjeta;
